import React, {Component} from 'react'
import {BrowserRouter as Router, Route, Routes, Link} from 'react-router-dom'
import withNavigation from './WithNavigation'
import withParams from './withParams'
import AuthenticationService from './AuthenticationService.js'
import AuthenticatedRoute from './AuthenticatedRoute'
import LoginComponent from './LoginComponent'
import ListTodoComponent from './ListTodoComponent'

class TodoApp extends Component {
    render() {
        const LoginComponentWithNavigation = withNavigation(LoginComponent)
        const WelcomeComponentWithParams = withParams(WelcomeComponent)
        const HeaderComponentWithNavigation = withNavigation(HeaderComponent)
        return (
            <div className = "TodoApp">
                <Router>
                    <HeaderComponentWithNavigation/>
                    <Routes>
                        <Route path = "/" element={<LoginComponentWithNavigation/>}/>
                        <Route path = "/login" element = {<LoginComponentWithNavigation/>}/>
                        <Route path = "/logout" element = {<AuthenticatedRoute><LogoutComponent/></AuthenticatedRoute>}/>
                        <Route path = "/todos" element = {<AuthenticatedRoute><ListTodoComponent/></AuthenticatedRoute>}/>
                        <Route path = "/welcome/:name" element = {<AuthenticatedRoute><WelcomeComponentWithParams/></AuthenticatedRoute>}/>  
                        <Route path = "*" element = {<ErrorComponent/>}/>
                    </Routes>
                    <FooterComponent/>
                </Router>
                {/*<LoginComponent/>
                <WelcomeComponent/>*/}
            </div>
        )
    }
}

class WelcomeComponent extends Component {
    render() {
        return (
            <>
                <h1>Welcome!</h1>
                <div className="container">
                Welcome {this.props.params.name}. You can manage your todos <Link to = "/todos">here</Link>.
                </div>
            </>
        )
    }
}

class HeaderComponent extends Component {
    render() {
        const isUserLoggedIn = AuthenticationService.isUserLoggedIn()

        return (
            <header>
                <nav className="navbar navbar-expand-md navbar-dark bg-dark">
                    <div><a herf="http://www.google.com" className="navbar-brand">Todo App</a></div>
                    <ul className="navbar-nav">
                        {isUserLoggedIn && <li><Link className="nav-link" to="/welcome/admin">Home</Link></li>}
                        {isUserLoggedIn && <li><Link className="nav-link" to="/todos">Todos</Link></li>}
                    </ul>
                    <ul className="navbar-nav navbar-collapse justify-content-end">
                        {!isUserLoggedIn && <li><Link className="nav-link" to="/login">Login</Link></li>}
                        {isUserLoggedIn && <li><Link className="nav-link" to="/logout" onClick={AuthenticationService.logout}>Logout</Link></li>}
                    </ul>
                </nav>
            </header>
        )
    }
}

class FooterComponent extends Component {
    render() {
        return (
            <footer className='footer'>
                <span className='text-muted'>
                    All rights reserved
                </span>
            </footer>
        )
    }
}

class LogoutComponent extends Component {
    render() {
        return (
            <div>
                <h1>You are logged out</h1>
                <div className="container">
                    Thank you for using the application.
                </div>
            </div>
        )
    }
}

function ErrorComponent() {
    return <div>Error</div>
}

export default TodoApp
